def binary_search(arr, item):
    start = 0
    end = len(arr)-1

    while start <= end:
        mid = (start + end) // 2
        guess = arr[mid]
        if guess == item:
            return mid
        else:
            if guess > item:
                end = end - 1
            else:
                start = start + 1
    return None

