def longest_common_prefix(strings):
    if len(strings) == 0: 
        return ''

    prefix = strings[0]
    for s in strings:
        i = 0 
        while i < len(prefix) and i < len(s) and s[i] == prefix[i]: 
            i += 1 
        prefix = prefix[:i] 
    return prefix 

