    start = 0
    end = len(lst) - 1
    while start <= end: 
        mid = (start + end)//2
        if lst[mid] == num: 
            return mid 
        elif lst[mid] > num: 
            end = mid - 1
        else: 
            start = mid + 1
    return -1

